window.onload=new function(){for(var t=document.getElementsByTagName("img"),e=0;e<t.length;e++)t[e].hasAttribute("data-src")&&(t[e].setAttribute("src",t[e].getAttribute("data-src")),t[e].removeAttribute("data-src",""));var r=document.querySelectorAll(".image-wrapper");for(e=0;e<r.length;++e)r[e].removeAttribute("style")};